import Topo from "../Topo";
import Menu from "../Menu"

export default function Historico({user}){
    return(
        <>
        <Topo user = {user}/>
            <h1>historico</h1>
            <p>Em breve você poderá ver o histórico dos seus hábitos aqui!</p>
        <Menu />
        </>
    );
}
